                <img src="https://haycafe.vn/wp-content/uploads/2021/11/Anh-avatar-dep-chat-lam-hinh-dai-dien.jpg" alt="" />
            </div>
            <h3 className="comment-name">Jonathan David</h3>
        </div>
    )
}
